As part of our continued commitment to creating engaging content, we thought to involve you: Brazzers fans, loyal supporters, and connoisseurs of quality adult entertainment. We are searching to add to our list of international producers. Ultimately, it is your feedback that we hold to heart while growing and developing the site. So, instead of simply choosing a new producer, we thought it would be best to ask you all to be the judge and jury. 13 producers answered the audition call. Please take the time to view their submissions below. The applicants were asked to create one scene, and sent identical packages, with the same guidelines and script, so you will be seeing the same content but interpreted in various ways. You are asked to evaluate the photoset quality, the storyline interpretation, sex performance and video quality.
